import React from 'react'

const ListEmployeeComponent = () => {
    const dummyData=[
        {
            "id":1,
            "firstName":"Srinivas",
            "lastName":"Chundru"
        },
        {
            "id":2,
            "firstName":"Sri",
            "lastName":"Chowdary"
        },
        {
            "id":3,
            "firstName":"Sam",
            "lastName":"Mary"
        }

    ]
    
    
  return (
    <div className='container'>
    <table className="table table-striped">
        <thead>
            <tr>
            <th scope="col">ID</th>
            <th scope="col">FirstName</th>
            <th scope="col">LastName</th> 
            </tr>
        </thead>
        {dummyData.map((obj) => (
                <tbody>
                <tr>
                <th scope="row">{obj.id}</th>
                <td>{obj.firstName}</td>
                <td>{obj.lastName}</td>
                </tr>
                </tbody>
        ))}
    
         
        </table>
    </div>
  )
}

export default ListEmployeeComponent
